import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CustomerListPage from './pages/CustomerListPage';
import CustomerFormPage from './pages/CustomerFormPage';
import CustomerDetailPage from './pages/CustomerDetailPage';


console.log('CustomerListPage:', CustomerListPage);
console.log('CustomerFormPage:', CustomerFormPage);
console.log('CustomerDetailPage:', CustomerDetailPage);

const App = () => (
  <Router>
    <div className="container">
      <h1>Customer Management App</h1>
      <Routes>
        <Route path="/" element={<CustomerListPage />} />
        <Route path="/customer/new" element={<CustomerFormPage />} />
        <Route path="/customer/edit/:id" element={<CustomerFormPage />} />
        <Route path="/customer/:id" element={<CustomerDetailPage />} />
      </Routes>
    </div>
  </Router>
);

export default App;
